import axios from 'axios';

const url="http://localhost:8000";

export const getPropertyInfo=async ()=>{
    try{
       const response= await axios.get(`${url}/properties`);
       //console.log(response.data);
       return response.data;
    }
    catch(error){
        console.log(error);
        return null;
    }
}
